#include "common.h"

class Solution {
public:
    vector<string> findRepeatedDnaSequences(string s) {
        unordered_set<string> res;
        if(s.length() <= 10)
            return vector<string>{};
        unordered_map<char, int> mm{{'A',1}, {'C',2}, {'G',3}, {'T',4}};
        unordered_map<long long, int > stat;
        long long cell = 0;
        for (int i = 0; i < 10; ++i) {
            cell = cell*10 + mm[s[i]];
        }
        stat[cell] = 1;
        int base = 1000000000;
        for (int i = 10; i < s.length(); ++i) {
            //get every substr stat and get the substr whose stat is equal and string is equal and index - current index >= 10
            cell = (cell - cell/base * base) * 10 + mm[s[i]];
            auto it = stat.find(cell);
            stat[cell] ++;
            if(stat[cell]  == 2)
                res.insert(s.substr(i-9, 10));
        }
        return vector<string>(res.begin(), res.end());
    }
};


int main(){
    //string s = "";
    //string s = "";
    string s = "AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT";
    auto r = Solution().findRepeatedDnaSequences(s);
    for(auto str: r){
        cout << str << endl;
    }
    return 1;
}